import fetch from 'isomorphic-fetch';


export async function getImages(key) {
  let body = {key: key};
  let req = await fetch('/express_backend', {
    method: 'GET',
    body,
  })
  .catch(err => {
    console.log('error: ', err);
  });
  let res = await req.json();
  console.log('this is the res: ', res);
  return res;
}
